@Component({
  selector: 'app-nav-bar',
  templateUrl: './nav-bar.component.html',
  styleUrls: ['./nav-bar.component.scss']
})
export class NavBarComponent {

}
<div
  class="containter"
  style="
    height: 35px;
    display: flex;
    align-items: center;
    justify-content: space-between;
  "
>
  <div class="wrap">
    <img src="" alt="logo" />
    <input type="text" name="search" placeholder="Найти работу" />
    <div>
      <button>Войти</button>
      <button>Регистрация</button>
    </div>
  </div>
</div>
